import React from "react";
import "./form-input.styles.scss";

function FormInput({ label, ...otherProps }) {
  return (
    <div className="group">
      {label && (
        <label
          className={`${
            otherProps.value.length ? "shrink" : ""
          } form-input`}
        >
          {label}
        </label>
      )}
      <input {...otherProps} />
    </div>
  );
}

export default FormInput;
